01110     public void LambdaFunction_Expression_SingleParameter()
01111     {
01112         /*
01113         Goal: Parse lambda expression variable declarations (2024-11-03)
01114         ================================================================
01115         
01116         'intPerson' is to signify 'int' or 'Person' because this is a 'keyword' and an 'identifier'.
01117         So remember the general type clause matching not just an identifier.
01118         
01119             Rename 'x' to 'argsX'?
01120         
01121             Technically 'intPerson' does not encompass the case of a contextual keyword...
01122                 -10 points
01123         
01124         Cases:
01125             ================================================================
01126             | () => ...;
01127             | 
01128             |   BreakList: [(StatementDelimiterToken, null)]
01129             |   EmptyExpressionNode + OpenParenthesisToken =>
01130             |   {
01131             |       Push(new ParenthesizedExpressionNode());
01132             |       return new EmptyExpressionNode();
01133             |   }
01134             |       
01135             |       BreakList: [(StatementDelimiterToken, null), (CloseParenthesisToken, ParenthesizedExpressionNode)]
01136             |       EmptyExpressionNode + CloseParenthesisToken =>
01137             |       {
01138             |           if (peek(1)==EqualsToken && peek(2)==CloseAngleBracketToken)
01139             |               return LambdaExpressionNode;
01140             |           else
01141             |               return ParenthesizedExpressionNode;
01142             |       }
01143             |
01144             | Related case of ParenthesizedExpressionNode with empty inner expression then StatementDelimiterToken:
01145             |   ();
01146             
01147             ================================================================
01148             | x => ...;
01149             |
01150             | Related case of VariableAssignmentExpressionNode:
01151             |   x = ...;
01152             |
01153             | Related case of FunctionInvocationNode:
01154             |   x();
01155             
01156             ================================================================
01157             | intPerson x => ...;
01158             | 
01159             |   This case is actually quite unique.
01160             |       AmbiguousIdentifierNode AmbiguousIdentifierNode => ...;
01161             |
01162             |   Two consecutive AmbiguousIdentifierNode(s) can happen in other syntax.
01163             |       But, these other syntax begin with a keyword.
01164             |       So, the lack of a keyword prior to the two nodes is indicative of it being a lambda expression.
01165             |
01166             |         Perhaps check if following the two nodes there is a '=>' syntax prior to deciding it is a lambda expression.
01167             |       If there is NOT '=>' then decide it is a BadExpressionNode.
01168             | 
01169             |       Although, this actually is the exact same scenario as:
01170             |           (intPerson x) => ...;
01171             |
01172             |       It is the same because they both start with an EmptyExpressionNode upon encountering the two consecutive
01173             |       AmbiguousIdentifierNode(s).
01174             |
01175             |       So, only checking for the next few tokens to be '=>' won't work.
01176             |       Because there could be an unknown amount of parameters being defined, such that a ',' is found instead of a '=>'.
01177             |       As well, there could be ')' found if reading the final parameter.
01178             
01179             ================================================================
01180             | (x) => ...;
01181             | 
01182             |   BreakList: [(StatementDelimiterToken, null)]
01183             |   EmptyExpressionNode + OpenParenthesisToken =>
01184             |   {
01185             |       Push(new ParenthesizedExpressionNode());
01186             |       return new EmptyExpressionNode();
01187             |   }
01188             |       
01189             |       BreakList: [(StatementDelimiterToken, null), (CloseParenthesisToken, ParenthesizedExpressionNode)]
01190             |       EmptyExpressionNode + IdentifierToken => AmbiguousIdentifierExpressionNode;
01191             |
01192             |       BreakList: [(StatementDelimiterToken, null), (CloseParenthesisToken, ParenthesizedExpressionNode)]
01193             |       AmbiguousIdentifierExpressionNode + CloseParenthesisToken =>
01194             |       {
01195             |           if (peek(1)==EqualsToken && peek(2)==CloseAngleBracketToken)
01196             |               return LambdaExpressionNode;
01197             |           else
01198             |               return ParenthesizedExpressionNode;
01199             |       }
01200             |
01201             | Related case of explicit casting:
01202             |   (intPerson)x;
01203             |       EmptyExpressionNode + OpenParenthesisToken => ParenthesizedExpressionNode;
01204             |       
01205             |   (intPerson) => ...;
01206             |       EmptyExpressionNode + OpenParenthesisToken => ParenthesizedExpressionNode;
01207             
01208             ================================================================
01209             | (intPerson x) => ...;
01210             |
01211             |   One of the main issues that I'm having is how to track the 'intPerson x' during the
01212             |       time spent as a ParenthesizedExpressionNode.
01213             |
01214             |   The same is true for 'x, y'.
01215             |
01216             |   Because these syntax are nonsensical to the ParenthesizedExpressionNode.
01217             |
01218             |   I could store each 'AmbiguousIdentifierNode' in the SyntaxList property of a 'BadExpressionNode'.
01219             |
01220             |   Then, if I later determine that im looking at a LambdaExpressionNode
01221             |       I can give the LambdaExpressionNode the 'BadExpressionNode'.
01222             |
01223             |   At that point the LambdaExpressionNode can then make sense of the 'BadExpressionNode' itself.
01224             |
01225             |   If the BadExpressionNode's SyntaxList is: { 'intPerson', 'x' }.
01226             |       Then the LambdaExpressionNode can iterate over each item,
01227             |       and take two consecutive AmbiguousIdentifierNode(s) to be a TypeClauseNode and "variable identifier".
01228             | 
01229             |   Maybe if the LambdaExpressionNode finds 3 consecutive AmbiguousIdentifierNode(s),
01230             |       then the LambdaExpressionNode itself is a BadExpressionNode?
01231             |
01232             |   If the LambdaExpressionNode finds a CommaToken, then it can start tracking a new parameter.
01233             |
01234             |   I'd prefer to not construct an instance of ParenthesizedExpressionNode, just to later replace
01235             |       it with the construction of a LambdaExpressionNode.
01236             |
01237             |   But, that concern is likely a minor detail relative to the whole of getting the C# Parser to work correctly.
01238             
01239             ================================================================
01240             | (x, y, *) => ...;
01241             
01242             ================================================================
01243             | (intPerson x, y, *) => ...;
01244             
01245             ================================================================
01246             | (x, intPerson y, *) => ...;
01247             
01248             ================================================================
01249             | (intPerson x, intPerson y, *) => ...;
01250             
01251             ================================================================
01252             | async ... => ...;
01253         */
01254         
01255         var test = new Test("(x => \"Abc\")");
01256         var topCodeBlock = test.CompilationUnit.RootCodeBlockNode;
01257         
01258         WriteChildrenIndented(topCodeBlock);
01259         
01260         var parenthesizedExpressionNode = (ParenthesizedExpressionNode)topCodeBlock.GetChildList()[1];
01261         var lambdaExpressionNode = (LambdaExpressionNode)parenthesizedExpressionNode.InnerExpression;
01262         
01263         Assert.True(lambdaExpressionNode.CodeBlockNodeIsExpression);
01264         
01265         Assert.Equal(1, lambdaExpressionNode.VariableDeclarationNodeList.Count);
01266         
01267         var parameter = lambdaExpressionNode.VariableDeclarationNodeList[0];
01268         Assert.Equal(TypeFacts.Empty.ToTypeClause(), parameter.TypeClauseNode);
01269         Assert.Equal("x", parameter.IdentifierToken.TextSpan.GetText());
01270         Assert.Equal(VariableKind.Local, parameter.VariableKind);
01271     }
