01604     [Fact]
01605     public void SwitchStatement()
01606     {
01607         /*
01608         - The switch statement cannot be part of an expression.
01609         - For this reason, it starts with the keyword switch,
01610             so when parsing it can easily be seen at the start of the
01611             statement, that it is a switch statement.
01612         - Switch expression can be embedded,
01613             and for that reason it starts with the IdentifierToken,
01614             in order to enter the expression parsing code,
01615             which then goes on to see the 'switch' keyword.
01616         - It isn't to say that the language had to be written this way.
01617         - But instead that it seems extremely intentional.
01618         - The switch statement has a scope for its initial body.
01619         - But, the individual case(s) do not create their own scopes.
01620         - One can put an "arbitrary code block" after the 'case' definition,
01621             in order to create a scope for that 'case' specifically.
01622             - But note: this just always the case in C# it isn't 'switch' specific.
01623         - In C# a switch statement cannot fall through its case(s) after
01624             handling the initial case that jumped to.
01625         - Many labels can be defined for the same "handling code".
01626         - A 'default' label exists.
01627         - 'goto default' also exists, but is this not just normal C#?
01628             you can goto any label you have in scope this isn't something special.
01629         - But maybe the 'default' name for the label is uniquely a 'switch' statement permitted name.
01630         - Are you able to goto any of the " case 'a': " label definitions?
01631               - If you wanted to do this, but could not "goto case 'a': "
01632                     could you put a normal C# label alongside " case 'a': "
01633                     and goto the normal C# label?
01634                     - I presume you could ONLY if you put the normal C# label
01635                         after the 'case' and before the "handling code".
01636                         - You could probably put a label anywhere within the "handling code" too,
01637                             but I'm speaking of this example specifically where you
01638                             wanted to jump in a equivalent way as "goto case 'a': ".
01639                             So in this case you'd  want it after the label, and at the start of the "handling code".
01640         - Is it possible to parse the switch statement's body as normal C# code, if I implemented C# label syntax?
01641             - The issue would appear to be with the 'case' keyword that is at the start of "label".
01642             - As well, the "label" doesn't have an IdentifierToken, it instead is a unique compile time constant.
01643         - The 'switch' statement would be a code block builder that skips until 'case', then skips until ':'.
01644         - At this point return to the main parser loop.
01645         - Then hit the 'case' keyword which would actually invoke its own method so I could probably do this easily.
01646             - public static void HandleCaseTokenKeyword(KeywordToken consumedKeywordToken, CSharpParserModel model) {...}
01647                 - ParseDefaultKeywords.cs:48 is where the method is defined.
01648         - So, the switch statement needs to have its expression parsed (the one within its parentheses).
01649             - Then it goes to main loop and starts parsing the code block node.
01650             - This then hits the 'case' keyword.
01651             - Read until the ':' then return back out again.
01652               - But, what about the 'default' keyword?
01653               - If the statement parsing code sees the 'default' keyword,
01654                     then check if the next token is the ColonToken.
01655                     - If so, then it is the 'default' leg of the switch statement.
01656         - This sounds like an effective "first approach" to a solution.
01657         - In order to track each leg of the switch statement I can create a new
01658             CodeBlockBuilder but, have this builder act in a special way.
01659             - It would capture the statements just as a normal CodeBlockBuilder,
01660                 but when the code block is finished, it moves its nodes to the parentCodeBlockBuilder.
01661                 - In the end, the "special" code block builder for the legs would just track the start and end indices.
01662                 - But, isn't the start the label, and the end the next label or CloseBraceToken?
01663         - Currently the expression parser is trying to parse the 'ColonToken' in " case 'a': ".
01664             - If the statement parser loop could "skip" over this, the parser would be in a better "state" for parsing the
01665                 remainder of the file.
01666         */
01667     
01668         var test = new Test(
01669 @"
01670 switch (character)
01671 {
01672     case 'a':
01673     {
01674         break;
01675     }
01676     case 'b':
01677     case 'c':
01678         break;
01679     case 'd':
01680         if (false)
01681             goto default;
01682         break;
01683     default:
01684         break;
01685 }
01686 ");
01687         var topCodeBlock = test.CompilationUnit.RootCodeBlockNode;
01688         
01689         throw new NotImplementedException();
01690     }
