01970     
01971     private void WriteChildrenIndented(ISyntaxNode node, string name = "node")
01972     {
01973         Console.WriteLine($"foreach (var child in {name}.GetChildList())");
01974         foreach (var child in node.GetChildList())
01975         {
01976             Console.WriteLine("\t" + child.SyntaxKind);
01977         }
01978         Console.WriteLine();
01979     }
01980     
01981     private void WriteChildrenIndentedRecursive(ISyntaxNode node, string name = "node", int indentation = 0)
01982     {
01983         var indentationStringBuilder = new StringBuilder();
01984         for (int i = 0; i < indentation; i++)
01985             indentationStringBuilder.Append('\t');
01986         
01987         Console.WriteLine($"{indentationStringBuilder.ToString()}{node.SyntaxKind}");
01988         
01989         // For the child tokens
01990         indentationStringBuilder.Append('\t');
01991         var childIndentation = indentationStringBuilder.ToString();
01992         
01993         foreach (var child in node.GetChildList())
01994         {
01995             if (child is ISyntaxNode syntaxNode)
01996             {
01997                 WriteChildrenIndentedRecursive(syntaxNode, "node", indentation + 1);
01998             }
01999             else if (child is ISyntaxToken syntaxToken)
02000             {
02001                 Console.WriteLine($"{childIndentation}{child.SyntaxKind}__{syntaxToken.TextSpan.GetText()}");
02002             }
02003         }
02004         
02005         if (indentation == 0)
02006             Console.WriteLine();
02007     }
02008 }
